import React from 'react';
import './ImageLinkForm.css';

const ImageLinkForm = () => {
    return (
        <div>
            <p className='f3 white'>
                <strong>{'This magic brain will detect faces in your pictures. Give it a try!'}</strong>
            </p>
            <div className= 'center'>
                <div className= 'pa4 br3 shadow-4 center'>
                    <input className= 'f4 pa2 w-70 center' type='text' />
                    <button className= 'fw5 w-30 grow f4 link ph3 pv2 dib white bg-light-purple'>Detect</button>
                </div>
            </div>
        </div>
    );
}

export default ImageLinkForm;
